import React from "react";
const Nav = () => {
  return (
    <nav className="navbar navbar-primary bg-primary" >
      <div className="container-fluid" style={{textAlign:'center' ,display:'flex',justifyContent:'center',color:'white'}}>
        <h1 >
            Attedence Management System
        </h1>
      </div>
    </nav>
  );
};

export default Nav;
